import React from "react";

const Fooditems = ({
  macro: { nutrientName, unitName, value, nutrientId },
}) => {
  return (
    <tr>
      {nutrientId > 1005 ? (
        <tr >
          <th>{nutrientName}</th>
          <th>{unitName}</th>
          <th>{value}</th>
        </tr>
      ) : (
        <tr>
          <th>{nutrientName}</th>
          <th>{unitName}</th>
          <th>{value}</th>
        </tr>
      )}
    </tr>
  );
};

export default Fooditems;
